(188, 'Perbarui ketentuanpenetapan', 'UPDATE', '{\"_method\":\"PUT\",\"konten\":\"<p>Syarat untuk membuat Kartu Keluarga (KK) baru, memperbarui KK, atau mengganti KK karena perubahan anggota bervariasi.&nbsp;<\\/p><p>Syarat pembuatan KK baru&nbsp;<\\/p><ul><li>Mengisi formulir permohonan KK<\\/li><li>Fotokopi buku nikah atau akta perkawinan<\\/li><li>Surat keterangan pindah datang<\\/li><li>Fotokopi kutipan akta kelahiran atau ijazah\\/STTB bagi calon anggota keluarga baru<\\/li><\\/ul><p>Syarat memperbarui KK KK lama, KTP, Surat kematian, Surat nikah.&nbsp;<\\/p><p>Syarat mengganti KK karena perubahan anggota&nbsp;<\\/p><ul><li>Formulir permohonan KK<\\/li><li>Kartu keluarga asli<\\/li><li>Surat keterangan kematian dari desa atau kelurahan<\\/li><li>Fotokopi kutipan akta kelahiran atau ijazah\\/STTB<\\/li><li>Surat keterangan pindah<\\/li><li>Surat keterangan kematian (bagi yang meninggal dunia)<\\/li><li>Surat keterangan pindah\\/pindah datang (bagi penduduk yang pindah)<\\/li><\\/ul><p>Syarat mengganti KK karena hilang atau rusak Surat keterangan kehilangan KK dari polisi, Formulir penerbitan KK, KK yang rusak.&nbsp;<\\/p><p>Untuk membuat KK, Anda bisa datang ke kantor kelurahan setempat dan kemudian melanjutkan ke kantor kecamatan.&nbsp;<\\/p>\",\"_token\":\"sldMcuwI1uMGJI0ZBplSICZ6McV8ZxiI7pGMmiOK\",\"new_password\":\"$2y$12$gdsDATGP38A9nSIWRnn\\/NONMRsPcnPG9EDtGptiAhxRJOM28ffZ4C\",\"new_password_confirmation\":\"$2y$12$sFbA05FSZ9z7Z4KlJm.ffuKyS4CX4pHoNBT0CY03nn8AxkSO3jGjG\",\"old_password\":\"$2y$12$vOgYQGomDHwW7y1S0L4XAOamQ2UUpLTbMXUjdBtu9kx4FPikuTsv6\",\"password\":\"$2y$12$no4oPRUCfFN8AEddDZcWIuFaqJixykDjb1TYm.SOH7mo0BVaQMcQu\"}', '{\"id\":5,\"konten\":\"<p>zsdfz s<\\/p><ul><li>xfghx&nbsp;<\\/li><li>chfj<\\/li><li>xfgh<\\/li><\\/ul>\",\"created_at\":\"2025-02-14T08:56:40.000000Z\",\"updated_at\":\"2025-02-14T08:56:40.000000Z\"}', '{\"id\":5,\"konten\":\"<p>Syarat untuk membuat Kartu Keluarga (KK) baru, memperbarui KK, atau mengganti KK karena perubahan angg