(1578, 'ketentuanpenetapans/5', NULL, 'PUT', '{\"_method\":\"PUT\",\"konten\":\"<p>Syarat untuk membuat Kartu Keluarga (KK) baru, memperbarui KK, atau mengganti KK karena perubahan anggota bervariasi.&nbsp;<\\/p><p>Syarat pembuatan KK baru&nbsp;<\\/p><ul><li>Mengisi formulir permohonan KK<\\/li><li>Fotokopi buku nikah atau akta perkawinan<\\/li><li>Surat keterangan pindah datang<\\/li><li>Fotokopi kutipan akta kelahiran atau ijazah\\/STTB bagi calon anggota keluarga baru<\\/li><\\/ul><p>Syarat memperbarui KK KK lama, KTP, Surat kematian, Surat nikah.&nbsp;<\\/p><p>Syarat mengganti KK karena perubahan anggota&nbsp;<\\/p><ul><li>Formulir permohonan KK<\\/li><li>Kartu keluarga asli<\\/li><li>Surat keterangan kematian dari desa atau kelurahan<\\/li><li>Fotokopi kutipan akta kelahiran atau ijazah\\/STTB<\\/li><li>Surat keterangan pindah<\\/li><li>Surat keterangan kematian (bagi yang meninggal dunia)<\\/li><li>Surat keterangan pindah\\/pindah datang (bagi penduduk yang pindah)<\\/li><\\/ul><p>Syarat mengganti KK karena hilang atau rusak Surat keterangan kehilangan KK dari polisi, Formulir penerbitan KK, KK yang rusak.&nbsp;<\\/p><p>Untuk membuat KK, Anda bisa datang ke kantor kelurahan setempat dan kemudian melanjutkan ke kantor kecamatan.&nbsp;<\\/p>\",\"_token\":\"sldMcuwI1uMGJI0ZBplSICZ6McV8ZxiI7pGMmiOK\"}', '127.0.0.1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/133.0.0.0 Safari/537.36 Edg/133.0.0.0', 5, '[\"pntjt\"]', 'Edge', 'Windows', 'WebKit', 0, '2025-02-24 10:35:30', '2025-02-24 10:35:30'),
